// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract Cryptovale is ERC721Enumerable, Ownable {
    using SafeMath for uint256;
    using Counters for Counters.Counter;

    Counters.Counter private _tokenIdTracker;

    uint256 public constant MAX_ELEMENTS_OWNER = 4444; //100 reserved for giveaways
    uint256 public constant MAX_ELEMENTS_OTHER = 4344;
    uint256 public constant PRICE = 4 * 10**16; // .04 eth
    uint256 public constant MAX_BY_MINT = 5;
    uint256 public constant MAX_PER_WALLET = 10;

    bool public isSaleOpen = false;
    bool public isPaused = false;

    IERC20 public WETH;

    address public teamWallet = 0xC07650C5B462626fd41e0cb4627FDFcD1E7C4904;

    string public baseTokenURI;

    event CreateGirl(uint256 indexed id);

    constructor(string memory baseURI, address wethAddress)
        ERC721("Cryptovale", "CRYPTOVALE")
    {
        WETH = IERC20(wethAddress);
        setBaseURI(baseURI);
    }

    modifier saleIsOpen() {
        if (_msgSender() != owner()) {
            require(isSaleOpen, "Sale is not open");
        }
        _;
    }

    function _totalSupply() internal view returns (uint256) {
        return _tokenIdTracker.current();
    }

    function totalMint() public view returns (uint256) {
        return _totalSupply();
    }

    function mint(
        address _to,
        uint256 _count
    ) public saleIsOpen {
        uint256 total = _totalSupply();
       if(_msgSender()!=owner()){
            require(total + _count <= MAX_ELEMENTS_OTHER, "Max limit");
            require(!isPaused, "Minting is paused.");
            require(_count <= MAX_BY_MINT, "Exceeds number");
            require(balanceOf(_msgSender()) + _count <= MAX_PER_WALLET, "Exceeds max allowed per wallet");
            require(
                WETH.balanceOf(msg.sender) >= price(_count),
                "Insufficient balance"
            );
            WETH.transferFrom(msg.sender, teamWallet, price(_count));
       }else{
           require(total + _count <= MAX_ELEMENTS_OWNER, "Max limit");
       }

        for (uint256 i = 0; i < _count; i++) {
            _mintAnElement(_to);
        }
    }

    function _mintAnElement(address _to) private {
        uint256 id = _totalSupply();
        _tokenIdTracker.increment();
        _safeMint(_to, id);
        emit CreateGirl(id);
    }

    function pauseSale() external onlyOwner {
        isPaused = true;
    }

    function resumeSale() external onlyOwner {
        isPaused = false;
    }

    function setBaseURI(string memory baseURI) public onlyOwner {
        baseTokenURI = baseURI;
    }

    function setSaleOpen() external onlyOwner {
        isSaleOpen = true;
    }

    function setTeamWallet(address wallet) external onlyOwner {
        teamWallet = wallet;
    }

    function price(uint256 _count) public pure returns (uint256) {
        return PRICE.mul(_count);
    }

    function _baseURI() internal view virtual override returns (string memory) {
        return baseTokenURI;
    }

    function tokenURI(uint256 tokenId)
        public
        view
        virtual
        override
        returns (string memory)
    {
        require(
            _exists(tokenId),
            "ERC721Metadata: URI query for nonexistent token"
        );

        uint256 metaId = tokenId +1;
        string memory uriSuffix = ".json";
        string memory currentBaseURI = _baseURI();
        return
            bytes(currentBaseURI).length > 0
                ? string(abi.encodePacked(currentBaseURI,uint2str(metaId), uriSuffix ))
                : "";
    }

    function walletOfOwner(address _owner)
        external
        view
        returns (uint256[] memory)
    {
        uint256 tokenCount = balanceOf(_owner);

        uint256[] memory tokensId = new uint256[](tokenCount);
        for (uint256 i = 0; i < tokenCount; i++) {
            tokensId[i] = tokenOfOwnerByIndex(_owner, i);
        }

        return tokensId;
    }

    function uint2str(uint _i) internal pure returns (string memory _uintAsString) {
        if (_i == 0) {
            return "0";
        }
        uint j = _i;
        uint len;
        while (j != 0) {
            len++;
            j /= 10;
        }
        bytes memory bstr = new bytes(len);
        uint k = len;
        while (_i != 0) {
            k = k-1;
            uint8 temp = (48 + uint8(_i - _i / 10 * 10));
            bytes1 b1 = bytes1(temp);
            bstr[k] = b1;
            _i /= 10;
        }
        return string(bstr);
    }

}
